import './SignUp.css';

function SignUp() {
  return (
    <>
        <form className="signup" onSubmit={handleSubmit}>
      <label>
        Email:
        <input
          type="email"
          name="email"
          value={formData.email}
          onChange={handleChange}
          required
        />
      </label>

      <label>
        Password:
        <input
          type="password"
          name="password"
          value={formData.password}
          onChange={handleChange}
          required
        />
      </label>

      <label>
        Repeat Password:
        <input
          type="password"
          name="repeatPassword"
          value={formData.repeatPassword}
          onChange={handleChange}
          required
        />
      </label>

      <button type="submit">Sign Up</button>
    </form>
    </>

  );
}

export default SignUp;
